// src/app/pages/Results1/Results1.jsx
import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import DonutChart from '../../components/DonutChart/DonutChart';
import './Results1.scss';

// You would replace this with your actual data from backend
const mockData = {
  topicQuestion: "Explain the concept of judicial review and its significance in U.S. law.",
  chartPercentage: 73,
  conceptBreakdown: [
    { name: "UNCLOS", color: "#B8F5B1", value: 40 },
    { name: "Exclusionary Rule", color: "#F5756B", value: 20 },
    { name: "Doctrine of Precedent", color: "#345B79", value: 15 },
    { name: "Hearsay Rule", color: "#E5EBF0", value: 25 }
  ],
  className: "Business Association",
  professorName: "LAWID B"
};

const Results1 = () => {
  const [currentIndex, setCurrentIndex] = useState(0);

  const handlePrevious = () => {
    setCurrentIndex(prev => Math.max(prev - 1, 0));
  };

  const handleNext = () => {
    // In a real application, you would check against the total number of results
    setCurrentIndex(prev => prev + 1);
  };

  return (
    <div className="pageContainer">
      <header className="header">
        <div className="headerContent">
          <div className="logoContainer">
            <h1 className="logo">CLASS INSIGHT</h1>
          </div>

          <nav className="mainNav">
            <Link to="/new-assignment" className="navItem">New Assignment</Link>
            <Link to="/past-assignments" className="navItem">Past Assignments</Link>
            <Link to="/ai-settings" className="navItem">AI Settings</Link>
            <Link to="/classes" className="navItem">Classes</Link>
          </nav>

          <div className="userInfo">
            <div className="classDropdown">
              <div className="dropdown">
                <span className="className">{mockData.className}</span>
                <span className="dropdownArrow">▼</span>
                <div className="professorName">{mockData.professorName}</div>
              </div>
            </div>
            <div className="userAvatar">
              <span>User</span>
            </div>
          </div>
        </div>
      </header>

      <main className="mainContent">
        <div className="resultHeader">
          <h1>Results</h1>
          <div className="actionButtons">
            <button className="questionIndexBtn">Q1</button>
            <button className="exportBtn">Open CSV</button>
          </div>
        </div>

        <div className="topicQuestion">
          {mockData.topicQuestion}
        </div>

        <div className="chartSection">
          <button className="navButton prevBtn" onClick={handlePrevious}>
            &lt;
          </button>

          <div className="donutChartContainer">
            <DonutChart 
              percentage={mockData.chartPercentage} 
              segments={mockData.conceptBreakdown} 
            />
          </div>

          <div className="legendContainer">
            {mockData.conceptBreakdown.map((concept, index) => (
              <div key={index} className="legendItem">
                <div className="legendColor" style={{ backgroundColor: concept.color }}></div>
                <div className="legendName">{concept.name}</div>
              </div>
            ))}
          </div>

          <button className="navButton nextBtn" onClick={handleNext}>
            &gt;
          </button>
        </div>

        <div className="bottomActions">
          <button className="actionButton downloadBtn">
            <span className="icon">↓</span>
          </button>
          <button className="actionButton shareBtn">
            <span className="icon">↗</span>
          </button>
        </div>
      </main>
    </div>
  );
};

export default Results1;
